import React from 'react';
import './l1.css';

function L1() {
  return (
    <div className='L1-body'>
        <h1>Alphabets</h1>
        <p>Similar to the alphabets in English,we have 52 alphabets in telugu.These alphabets are divided into two parts.They are
            <ol>
                <li>Vowels(16)</li>
                <li>Consonants(38)</li>
            </ol>
            Let's start with Vowels.
        </p>
    </div>
  )
}

export default L1
